import React from 'react'
import {FaGithub} from 'react-icons/fa'
import{Link} from 'react-router-dom'
import PropTypes  from 'prop-types'


function navbar({title}) {
  return (
    <div>navbar</div>
  )
}

navbar.defaultProps ={
  title: 'Github Finder'
}

navbar.propTypes ={
  title: PropTypes.string,
}





export default navbar
